import React from "react";
import '../FilterCheckbox/FilterCheckbox.css'

function FilterCheckbox(props) {
  return (
    <div className="filter-checkbox__switch-box">
      <p className="filter-checkbox__text">Короткометражки</p>
      <label className="filter-checkbox__switch-button">
        <input
          className="filter-checkbox__input"
          type="checkbox"
          onChange={props.checkShort}
          checked={props.onChecked}
        />
        {/* <span className="filter-checkbox__slider filter-checkbox__round"></span> */}
      </label>
      
    </div>
  );
}

export default FilterCheckbox;
